#pragma mark - 1. Recursion
// Time Limit Exceeded
// Passed 9 out of 90 test cases.
class Solution1 {
private:
    /**
     *
     * @param nums
     * @param startIndex Inclusive.
     * @param endIndex Inclusive.
     * @param x
     * @return
     */
    int minOperationsRecursively(const std::vector<int>& nums, int startIndex, int endIndex, int x) {
        if (x == 0) {
            return 0;
        } else if (x < 0) {
            return -1;
        }

        if (endIndex == startIndex) {
            if (x == nums[startIndex]) {
                return 1;
            } else {
                return -1;
            }
        }

        const int leftRemainingX = x - nums[startIndex];
        const int leftRemainingCount = minOperationsRecursively(nums, startIndex + 1, endIndex, leftRemainingX);

        const int rightRemainingX = x - nums[endIndex];
        const int rightRemainingCount = minOperationsRecursively(nums, startIndex, endIndex - 1, rightRemainingX);

        if (leftRemainingCount == -1) {
            if (rightRemainingCount == -1) {
                return -1;
            } else {
                return (rightRemainingCount + 1);
            }
        } else if (rightRemainingCount == -1) {
            return (leftRemainingCount + 1);
        } else {
            return std::min(leftRemainingCount, rightRemainingCount) + 1;
        }
    }

public:
    int minOperations(const std::vector<int>& nums, int x) {
        return minOperationsRecursively(nums, 0, nums.size() - 1, x);
    }
};


#pragma mark - 2. Sum up first m and n elements from left and right
// Time Limit Exceeded
// Passed 81 out of 90 test cases.
class Solution2 {
public:
    int minOperations(std::vector<int>& nums, int x) {
        int returnValue = 1;

        /// Sum from [0, i).
        auto leftSums = nums;
        for (auto it = (leftSums.begin() + 1); it != leftSums.end(); it += 1) {
            *it += *(std::prev(it));
        }
        leftSums.insert(leftSums.begin(), 0);

        /// Sum from (i, nums.size() - 1]
        auto rightSums = nums;
        for (auto it = (rightSums.rbegin() + 1); it != rightSums.rend(); it += 1) {
            *it += *(std::prev(it));
        }
        rightSums.push_back(0);
        std::reverse(rightSums.begin(), rightSums.end());

        while (returnValue <= nums.size()) {
            for (int leftCount = 0; leftCount <= returnValue; leftCount += 1) {
                const int rightCount = returnValue - leftCount;
                const int sum = leftSums[leftCount] + rightSums[rightCount];
                if (sum == x) {
                    return returnValue;
                }
            }

            returnValue += 1;
        }

        return -1;
    }
};


