class Solution3 {
public:
    int minOperations(std::vector<int>& nums, int x) {
        int returnValue = 1;

        /// Sum from [0, i).
        auto leftSums = nums;
        for (auto it = (leftSums.begin() + 1); it != leftSums.end(); it += 1) {
            *it += *(std::prev(it));
        }
        leftSums.insert(leftSums.begin(), 0);

        /// Sum from (i, nums.size() - 1]
        auto rightSums = nums;
        for (auto it = (rightSums.rbegin() + 1); it != rightSums.rend(); it += 1) {
            *it += *(std::prev(it));
        }
        rightSums.push_back(0);
        std::reverse(rightSums.begin(), rightSums.end());

        while (returnValue <= nums.size()) {
            bool smallerSumExists = false;
            for (int leftCount = 0; leftCount <= returnValue; leftCount += 1) {
                const int rightCount = returnValue - leftCount;
                const int sum = leftSums[leftCount] + rightSums[rightCount];
                if (sum == x) {
                    return returnValue;
                } else if (sum < x) {
                    smallerSumExists = true;
                }
            }
            if (smallerSumExists) {
                returnValue += 1;
            } else {
                return -1;
            }
        }

        return -1;
    }
};


#pragma mark - 4. Improved 2 and 3: Use hash table
// Runtime: 720 ms, faster than 14.40% of C++ online submissions for Minimum Operations to Reduce X to Zero.
// Memory Usage: 228.3 MB, less than 5.01% of C++ online submissions for Minimum Operations to Reduce X to Zero.
class Solution4 {
public:
    int minOperations(std::vector<int>& nums, int x) {
        int sumCache = 0;

        /// Sum from [0, i): minimum amount of numbers
        auto leftSums = std::unordered_map<int, int>({{0, 0}});
        for (size_t i = 0; i < nums.size(); i += 1) {
            sumCache += nums[i];
            if (leftSums.find(sumCache) == leftSums.end()) {
                // Only assign the value if it doesn't exist.
                leftSums[sumCache] = i + 1;
            }
        }
        sumCache = 0;

        /// Sum from (i, nums.size() - 1]: minimum amount of numbers
        auto rightSums = std::unordered_map<int, int>({{0, 0}});
        for (int i = (nums.size() - 1); i >= 0; i -= 1) {
            sumCache += nums[i];
            if (rightSums.find(sumCache) == rightSums.end()) {
                rightSums[sumCache] = nums.size() - i;
            }
        }

        int returnValue = INT_MAX;
        for (const auto& [leftSum, leftCount]: leftSums) {
            const int rightSum = x - leftSum;

            auto rightIt = rightSums.find(rightSum);

            if (rightIt != rightSums.end()) {
                if ((leftCount + rightIt->second) > nums.size()) {
                    // Not enough elements.
                    continue;
                }

                const int totalCount = leftCount + rightIt->second;
                returnValue = std::min(totalCount, returnValue);
            }
        }

        return (returnValue == INT_MAX)? -1: returnValue;
    }
};


