// Runtime: 884 ms, faster than 7.57% of C++ online submissions for Minimum Operations to Reduce X to Zero.
// Memory Usage: 163.3 MB, less than 22.06% of C++ online submissions for Minimum Operations to Reduce X to Zero.
class Solution5 {
public:
    int minOperations(std::vector<int>& nums, int x) {
        int sumCache = 0;

        /// Sum from [0, i): minimum amount of numbers
        auto leftSums = std::unordered_map<int, int>({{0, 0}});
        for (size_t i = 0; i < nums.size(); i += 1) {
            sumCache += nums[i];
            if (leftSums.find(sumCache) == leftSums.end()) {
                // Only assign the value if it doesn't exist.
                leftSums[sumCache] = i + 1;
            }
        }

        int returnValue = INT_MAX;

        // Special case: only use left elements.
        auto leftIt = leftSums.find(x);
        if (leftIt != leftSums.end()) {
            returnValue = leftIt->second;
        }

        // Start from right
        sumCache = 0;    // Right sum.
        for (int i = 1; i < nums.size(); i += 1) {
            sumCache += nums[nums.size() - i];

            const auto leftSum = x - sumCache;
            leftIt = leftSums.find(leftSum);

            if (leftIt != leftSums.end()) {
                const int totalCount = leftIt->second + i;

                if (totalCount > nums.size()) {
                    // Not enough elements.
                    continue;
                }

                returnValue = std::min(totalCount, returnValue);
            }
        }

        return (returnValue == INT_MAX)? -1: returnValue;
    }
};


#pragma mark - 6. Solution in LeetCode discussion: Find a subarray in the middle whose sum is (totalSum - x) (revisit, not my own solution)
// Source: https://leetcode.com/problems/minimum-operations-to-reduce-x-to-zero/discuss/935935/Java-Detailed-Explanation-O(N)-Prefix-SumMap-Longest-Target-Sub-Array
// Runtime: 812 ms, faster than 9.69% of C++ online submissions for Minimum Operations to Reduce X to Zero.
// Memory Usage: 148.5 MB, less than 32.45% of C++ online submissions for Minimum Operations to Reduce X to Zero.
class Solution6 {
public:
    int minOperations(std::vector<int>& nums, int x) {
        const int totalSum = std::accumulate(nums.begin(), nums.end(), 0);
        const int middleSubArraySum = totalSum - x;

        if (middleSubArraySum < 0) {
            return -1;
        } else if (middleSubArraySum == 0) {
            return nums.size();
        }

        /// Length of the middle sub array.
        int middleSubArrayLength = INT_MIN;

        auto leftSums = std::unordered_map<int, int>({{0, -1}});
        int sumCache = 0;

        for (int i = 0; i < nums.size(); i += 1) {
            sumCache += nums[i];
            /*
             * Unlike in 4 or 5, this time we want the middle subarray length to be as long as possible.
             *
             * So we overwrite previous values.
             */
            leftSums[sumCache] = i;

            const int previousLeftSum = sumCache - middleSubArraySum;    // Left segment value.
            const auto previousLeftIt = leftSums.find(previousLeftSum);
            if (previousLeftIt != leftSums.end()) {
                middleSubArrayLength = std::max(middleSubArrayLength, i - previousLeftIt->second);
            }
        }

        return (middleSubArrayLength == INT_MIN)? -1: (nums.size() - middleSubArrayLength);
    }
};


#pragma mark - 7. Sliding window solution to find a subarray in the middle whose sum is (totalSum - x) (revisit)
// This is in fact a "sliding window" solution.
// Runtime: 212 ms, faster than 58.71% of C++ online submissions for Minimum Operations to Reduce X to Zero.
// Memory Usage: 98.4 MB, less than 69.58% of C++ online submissions for Minimum Operations to Reduce X to Zero.
class Solution {
public:
    int minOperations(std::vector<int>& nums, int x) {
        const int totalSum = std::accumulate(nums.begin(), nums.end(), 0);
        const int middleSubArraySum = totalSum - x;

        int middleSubArrayLength = INT_MIN;

        int sumCache = 0;

        int left = 0;
        for (int right = 0; right < nums.size(); right += 1) {
            sumCache += nums[right];

            while ((sumCache > middleSubArraySum) && (left <= right)) {
                sumCache -= nums[left];
                left += 1;
            }

            if (sumCache == middleSubArraySum) {
                middleSubArrayLength = std::max(middleSubArrayLength, right - left + 1);
            }
        }

        return (middleSubArrayLength == INT_MIN)? -1: (nums.size() - middleSubArrayLength);
    }
};


